import UserService from "../service/UserService";

class UserList extends React.Component{
    constructor(){
        this.state = {
            users:[]
        }
    }

    componentDidMount(){
        UserService.getAll().then((response) => {
            this.setState({users:response.data})
        })
    }
    render(){
        return(
            <div>
                <p></p>
                <p></p>
                <p></p>
            </div>
        )
    }
}

export default UserList
